import React from 'react'
import { /*useState,*/ useEffect } from 'react';
import { useDispatch, useSelector } from 'react-redux';
import './Home.css'
import { getPopulares } from '../actions'









export default function Home() {
    const dispatch = useDispatch();
    const populares = useSelector((state => state.populares));


    useEffect (() =>{                              
        dispatch(getPopulares());                         
    }, [dispatch]);


    console.log('POPULARES: ', populares);

  return (
    <div>
        <h1>HOME</h1>
        {populares.results ? <h2>{populares.results.map(el => el.original_title)}</h2> : <h2>error</h2>}
        {populares.results ? <img src={populares.results[0].poster_path} alt=''></img> : <h2>error</h2>}
        {populares.results ? <h2>{'https://image.tmdb.org/t/p/original' + populares.results[0].poster_path}</h2> : <h2>error</h2>}
       
    </div>
  )
}
